import { Icon, Heading } from "../../components";
import { UserOverview_Styles } from "./Dash_Styles";

const Overview = ({ name = "", email = "", homePhone = "", players = [] }) => {
  return (
    <UserOverview_Styles>
      <Heading type="Small">{name}</Heading>
      {players.map(({ sport, name: n }) => (
        <>
          <Heading type="Small">{n}</Heading>
          <Icon type={sport} />
        </>
      ))}

      <span>
        <Icon type="phone" />
        <Heading type="Small">{homePhone}</Heading>
      </span>
      <span>
        <Icon type="mail" />
        <Heading type="Small">{email}</Heading>
      </span>
      <Icon type="message" messages={1} />
    </UserOverview_Styles>
  );
};

export default User_Overview;
